class Stack():    def __init__(self):        self.items=[]    def isEmpty(self):        return self.items==[]    def pop(self):        return self.items.pop()    def push(self,item1):        return self.items.append(item1)    def size(self):        return len(self.items)    def peep(self):        return self.items[len(self.items)-1]s=Stack()#implementing A queue using 2 stacks